CREATE DEFINER=`root`@`localhost` PROCEDURE `buscarRegionxID`(id int)
BEGIN
	select dis.*,p.nombre_provincia,d.* from ubigdistrito dis inner join ubigprovincia p 
    on dis.idubigprovincia=p.idubigprovincia inner join ubigdepartamento d 
    on p.idubigdepartamento=d.idubigdepartamento inner join postulante po 
    on po.idubigdistrito=dis.idubigdistrito
    where po.idPostulante=id;

END ;;
